    methods: {
        async getKonsul() {
            this.loading = true;
            this.loadingkomen = true;
			try{
                const sid = this.$route.params.id
				const headers = {
						'Content-Type': 'application/json',
						'Authorization': `Bearer ${localStorage.getItem('token')}`
					};
				const response = await this.$axios.post(import.meta.env.VITE_APP_API_URL+'/getKonsul',{
                    id:  sid,
                    cat: this.$route.params.xid
                },{headers})

                if(response.data.success == true){
				    this.data = response.data.data
				    this.komen = response.data.chat

                    console.log(this.komen)
                }else{
                    this.$toast.fire({
                        title: response.data.message,
                        icon: 'error',
                    })
                }
			} catch (error) {
				this.$toast.fire({
					title: error,
					icon: 'error',
				})
			} finally {
				this.loading = false;
                this.loadingkomen = false;
			}
        },
        async addKomen() {
            this.loadingkomen = true;
            console.log(this.input.komen);
            try{
                const noreq = this.$route.params.id
				const headers = {
								'Content-Type': 'application/json',
								'Authorization': `Bearer ${localStorage.getItem('token')}`
							};
                
				const response = await this.$axios.post(import.meta.env.VITE_APP_API_URL+'/addChatKonsul',{
					cat: this.$route.params.xid,
                    noreq: this.$route.params.id,
                    komen: this.input.komen
				}, {headers})
                
                if(response.data.success == true){
                    this.komen = response.data.komen
                    this.input.komen = ''
                }else{
